import React from "react";
import ag from "../assets/activityImage.png";

const Activities = () => {
  return (
    <container>
      <div className="activity-title">
        <h1>Extra Curricular Activites</h1>
      </div>
      <div className="activity">
        <div className="image">
          <img src={ag} alt="" />{" "}
        </div>
        <div className="activity-content">
          <h3>Content</h3>
        </div>
      </div>
    </container>
  );
};

export default Activities;
